css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("nationalreview.com") {

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, p, form, footer, div.TabbedPanelsContent, div.most_viewed_container, div.live-blog-feed-container, div.TabbedPanelsContent2, div.most_commented_container, .scrollable_scroll_cover2-scroll img, span.homie-deck, .homie-headline16, div#poll_questions, span.homie-headline, div.comment, div.comment-name, div.comment-date, div.indented, div.box, .form-item label, span.live_blog_deck

{
color: white !important;
background: black !important;
}

/*links*/

a

{
color: #0040ff !important;
}

.navigation a, .navigation_small a

{
background: black !important;
}

/*highlight*/

textarea, pre

{
background: #333333 !important;
}

}
